		u0, lo0 = bits.Mul64(m, q0)
		u1, lo1 = bits.Mul64(m, q1)
		u2, lo2 = bits.Mul64(m, q2)
		u3, lo3 = bits.Mul64(m, q3)
		u4, lo4 = bits.Mul64(m, q4)
