		t0, c0 = bits.Add64(t1, lo1, c0)
		t1, c0 = bits.Add64(t2, lo2, c0)
		t2, c0 = bits.Add64(t3, lo3, c0)
		t3, c0 = bits.Add64(t4, lo4, c0)
